PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE admin (
	id INTEGER NOT NULL, 
	user VARCHAR(20) NOT NULL, 
	pwd VARCHAR(40) NOT NULL, 
	name VARCHAR(20) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (user)
);
CREATE TABLE category (
	id INTEGER NOT NULL, 
	name VARCHAR(50) NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE warga (
	id INTEGER NOT NULL, 
	nik VARCHAR(20) NOT NULL, 
	no_kk VARCHAR(20) NOT NULL, 
	nama VARCHAR(120) NOT NULL, 
	jenis_kelamin VARCHAR(10) NOT NULL, 
	tgl_lahir VARCHAR(10) NOT NULL, 
	hubungan_kk VARCHAR(10), 
	agama VARCHAR(10), 
	pendidikan VARCHAR(20), 
	pekerjaan VARCHAR(20), 
	status_kawin VARCHAR(20), 
	rt INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (nik)
);
CREATE TABLE IF NOT EXISTS "PUS" (
	id INTEGER NOT NULL, 
	nik_suami VARCHAR(20) NOT NULL, 
	nik_isteri VARCHAR(20) NOT NULL, 
	jumlah_anak_hidup INTEGER NOT NULL, 
	pengukuran_lila VARCHAR(50) NOT NULL, 
	jan VARCHAR(10), 
	feb VARCHAR(10), 
	mar VARCHAR(10), 
	apr VARCHAR(10), 
	mei VARCHAR(10), 
	jun VARCHAR(10), 
	jul VARCHAR(10), 
	ags VARCHAR(10), 
	sep VARCHAR(10), 
	okt VARCHAR(10), 
	nov VARCHAR(10), 
	des VARCHAR(10), 
	tahun VARCHAR(4) NOT NULL, 
	ket VARCHAR(20), 
	PRIMARY KEY (id), 
	FOREIGN KEY(nik_suami) REFERENCES warga (nik), 
	FOREIGN KEY(nik_isteri) REFERENCES warga (nik)
);
CREATE TABLE balita (
	id INTEGER NOT NULL, 
	nik_anak VARCHAR(20) NOT NULL, 
	nik_ibu VARCHAR(20) NOT NULL, 
	anak_ke INTEGER, 
	bb FLOAT, 
	tb FLOAT, 
	asi FLOAT, 
	vit_a FLOAT, 
	bulan INTEGER NOT NULL, 
	tahun INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(nik_anak) REFERENCES warga (nik), 
	FOREIGN KEY(nik_ibu) REFERENCES warga (nik)
);
CREATE TABLE hamil (
	id INTEGER NOT NULL, 
	nik_ibu VARCHAR(20) NOT NULL, 
	nik_suami VARCHAR(20) NOT NULL, 
	anak_ke INTEGER, 
	jarak VARCHAR(20), 
	haid VARCHAR(20), 
	ket VARCHAR(20), 
	bulan INTEGER NOT NULL, 
	tahun INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(nik_ibu) REFERENCES warga (nik), 
	FOREIGN KEY(nik_suami) REFERENCES warga (nik)
);
CREATE TABLE bersalin (
	id INTEGER NOT NULL, 
	nik_ibu VARCHAR(20) NOT NULL, 
	nik_suami VARCHAR(20) NOT NULL, 
	anak_ke INTEGER NOT NULL, 
	tgl_lahir VARCHAR(10) NOT NULL, 
	bb FLOAT, 
	pb FLOAT, 
	tindakan VARCHAR(50), 
	ket VARCHAR(50), 
	bulan INTEGER NOT NULL, 
	tahun INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(nik_ibu) REFERENCES warga (nik), 
	FOREIGN KEY(nik_suami) REFERENCES warga (nik)
);
CREATE TABLE IF NOT EXISTS "post" (
	"id"	INTEGER NOT NULL,
	"title"	VARCHAR(100) NOT NULL,
	"date_posted"	DATETIME NOT NULL,
	"content"	TEXT NOT NULL,
	"admin_id"	INTEGER NOT NULL,
	"category_id"	INTEGER NOT NULL,
	"img"	VARCHAR(100),
	PRIMARY KEY("id"),
	FOREIGN KEY("category_id") REFERENCES "category"("id"),
	FOREIGN KEY("admin_id") REFERENCES "admin"("id")
);
CREATE TABLE jenis (
	id INTEGER NOT NULL, 
	nama VARCHAR(20) NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE produk (
	id INTEGER NOT NULL, 
	jenis_id INTEGER NOT NULL, 
	nama VARCHAR(20) NOT NULL, 
	harga VARCHAR(10) NOT NULL, 
	ket TEXT NOT NULL, 
	img VARCHAR(20) NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(jenis_id) REFERENCES jenis (id)
);
CREATE TABLE comment (
	id INTEGER NOT NULL, 
	post_id INTEGER NOT NULL, 
	name VARCHAR(10) NOT NULL, 
	text TEXT NOT NULL, 
	date_posted DATETIME NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(post_id) REFERENCES post (id)
);
COMMIT;
